import React, { useEffect } from 'react';
import { datadogRum } from '@datadog/browser-rum';

const MyComponent = () => {

    datadogRum.init({
          applicationId: 'e1aa6712-47da-4eb5-a4b2-2e77b7c12156',
          clientToken: 'pubfbbbc381458a8ee8a4b4c5f8f4524e95',
          site: 'us5.datadoghq.com',
          service: 'spritle-',
          env: 'Spritle01',
          version: '1.0.0',
          sessionSampleRate: 50, // Adjust as needed
          trackInteractions: true, // Enable/disable user interactions tracking
    })

    function onclick (){
      datadogRum.addAction('Submitted')
      log
    }

  return (
    <div>
      <button onClick={onclick}>Submit</button>
    </div>
  );
};

export default MyComponent;
